- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XA\x1CThis Amendment is in response to
    the Commission's letter dated April 4, 2013. Corrections have been made to the
    descriptions for disbursements in question reported on Schedule B supporting Line
    30(b). All payments for 'Printing/Exempt Campaign Paraphanelia-Obama' and 'Printing
    & Postage/Exempt Mail - Barrow for Congress'' were for activities that fully meet
    the definition of Exempt Activity. No funds received from the Democratic National
    Committee or the Democratic Congressional Campaign Committee were specifically
    earmarked for any exempt activities. Payments for 'Payroll,' 'Payroll Taxes' and
    'Health Insurance' on Schedule H4 are for those individuals who did not spend
    more than 25 of their time during the period on activity in connection with a
    federal election. Payments for 'Payroll' and 'Payroll Taxes' reported on Schedule
    B supporting Line 21(b) are for paid canvassers that did not spend any of their
    compensated time in a given month on Federal Election Activity or activities in
    connection with a Federal Election. The receipt on Line 17 are for voter file
    purchases. The prices paid for voter file purchases are established  using comparable
    prices charged by other state party committees throughout the country on a per
    record cost. The exact price paid to the Committee by each entity is determined
    by multiplying the per record cost by the number of records provided in the file
    purchased.  \n"
